import React from 'react';
import './TasksList.css'
import Task from '../Task/Task';

class File extends React.Component {
    data() {
        const [ntp, setntp] = useState([]);
        useEffect(() => {
            fetch("http://localhost:7654/files")
                .then((response) => response.json())
                .then((data) => setntp(data.dataAdb)).then(console.log(ntp));
        }, []);
    }
    render() {
        return (
            <div className='tasks-list-container'>
                <div className='form'>
                    <form>
                        <input className='input' placeholder='ðŸ” Search Files' />
                    </form>
                </div>
                <div className='tasks-list'>
                    {ntp.map(task => <Task key={task.key} text={task.text} id={task.id} removeTask={this.props.removeTask} />)}
                </div>
            </div>
        );
    }
}

export default File;
